import React from "react";

function ToDoList({ todos }) {
  return (
    <ul className="list">
      {todos.length == 0 && "You have completed all things"}
      {todos.map((todo) => {
        return (
          <li key={todo.id}>
            <label>
              <input
                type="checkbox"
                checked={todo.done}
                onChange={(e) => toogleTodo(todo.id, e.target.checked)}
              />
              {todo.title}
            </label>
            <button onClick={() => delTodo(todo.id)} className="btn btn-del">
              Delete
            </button>
          </li>
        );
      })}
    </ul>
  );
}

export default ToDoList;
